	const parseData = () => {
		let parsed = {}
		raw.forEach(spell => {
			let key = spell["spellname"]
			// if spell already exists
			if(parsed[key]){
				// if spell has a rank and this rank does not exist yet, add it
				if(spell["rank1"].includes("Rank") && !parsed[key + "(" + spell["rank1"] + ")"]) {
					parsed[key + "(" + spell["rank1"] + ")"] = [spell["id"], spell["description2"], spell["rank1"]]
				}
	
				if(spell["rank1"].includes("Rank")) {
					if(spell["rank1"].slice(-2) > parsed[key][2].slice(-2)) {
						parsed[key] = [spell["id"], spell["description2"], spell["rank1"]]
					}
				}
			}
			else {
				if(spell["rank1"].includes("Rank") && spell["baselevel"] > 0) {
					parsed[key] = [spell["id"], spell["description2"], spell["rank1"]]
					key += "(" + spell["rank1"] + ")"
				}
				else if(spell["rank1"].includes("Rank") && !parsed[key + "(" + spell["rank1"] + ")"]){
					parsed[key] = [spell["id"], spell["description2"], spell["rank1"]]
					key += "(" + spell["rank1"] + ")"
				}
				parsed[key] = [spell["id"], spell["description2"], spell["rank1"]]
			}
		})
		for(const key in parsed) {
			parsed[key] = parsed[key][0]
		}
		return parsed
	}

